components.custom:
var keys = {
  latitude: 'latitude',
  longitude: 'longitude',
  accuracy: 'accuracy',
  altitude: 'altitude',
  altitudeAccuracy: 'altitudeAccuracy'
};

// Gets Geolocation using device GPS / Location Services
var getGeolocation = function(form = {}, data = {}, keys = {}) {

  var overlay = document.createElement('div');
  overlay.style.width = '100%';
  overlay.style.height = '100%';
  overlay.style.position = 'fixed';
  overlay.style.backgroundColor = 'rgba(5, 116, 169, 0.5)';
  overlay.style.zIndex = '99999';
  overlay.style.top = '0';
  overlay.style.left = '0';
  overlay.style.textAlign = 'center';
  overlay.innerHTML = '<div class="loader-wrapper"><div class="loader"></div></div>';

  // On Success Event Dispatcher
  function onSuccessEventDispatcher(position) {
    console.log('[GPS] SUCCESS:', position);
    var onSuccessEvent = new CustomEvent('gpsSucceeded', {
      detail: {
        data: position,
        text: 'GPS Succeeded'
      }
    });
    Object.keys(keys).forEach(function(key) {
      var component = FormioUtils.getComponent(form.components, keys[key]);
      if (typeof component.setValue === 'function') {
        component.setValue(position.coords[key]);
      } else {
        data[component.key] = position.coords[key];
      }
