components.custom:
var keys = {
  latitude: 'inspectionPalms.latitude',
  longitude: 'inspectionPalms.longitude',
  accuracy: 'inspectionPalms.accuracy',
  altitude: 'inspectionPalms.altitude',
  altitudeAccuracy: 'inspectionPalms.altitudeAccuracy'
};

// Gets Geolocation using device GPS / Location Services
var getGeolocation = function(form = {}, data = {}, keys = {}) {

  var overlay = document.createElement('div');
  overlay.style.width = '100%';
  overlay.style.height = '100%';
  overlay.style.position = 'fixed';
  overlay.style.backgroundColor = 'rgba(5, 116, 169, 0.5)';
  overlay.style.zIndex = '99999';
  overlay.style.top = '0';
  overlay.style.left = '0';
  overlay.style.textAlign = 'center';
  overlay.innerHTML = '<div class="loader-wrapper"><div class="loader"></div></div>';

  // On Success Event Dispatcher
  function onSuccessEventDispatcher(position) {
    console.log('[GPS] SUCCESS:', position);
    var onSuccessEvent = new CustomEvent('gpsSucceeded', {
      detail: {
        data: position,
        text: 'GPS Succeeded'
      }
    });
    Object.keys(keys).forEach(function(key) {
      var component = FormioUtils.getComponent(form.components, keys[key]);
      if (typeof component.setValue === 'function') {
        component.setValue(position.coords[key]);
      } else {
        data[component.key] = position.coords[key];
      }
    });

    document.dispatchEvent(onSuccessEvent);
    overlay.remove();
  };

  // On Error Event Dispatcher
  function onErrorEventDispatcher(error) {
    console.log('[GPS] ERROR:', error);
    var onErrorEvent = new CustomEvent('gpsError', {
      detail: {
        data: error,
        text: 'GPS Error'
      }
    });
    document.dispatchEvent(onErrorEvent);
    overlay.remove();
  };

  // On Request Event Dispatcher
  function onRequestEventDispatcher() {
    document.querySelector('body').appendChild(overlay);
    console.log('[GPS] REQUEST');
    var onRequestEvent = new CustomEvent('gpsRequested', {
      detail: {
        data: keys,
        text: 'GPS requested'
      }
    });
    document.dispatchEvent(onRequestEvent);
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(onSuccessEventDispatcher, onErrorEventDispatcher, {
        maximumAge: 3000,
        timeout: 15000,
        enableHighAccuracy: true
      });
    } else {
      onErrorEventDispatcher('Geolocation not supported');
      console.log('Geolocation is not supported by this browser.');
    }
  };

  // Geolocation requested...
  onRequestEventDispatcher();
};

